    @Test
    fun parseFrXml() {
        val xml = """<?xml version="1.0" encoding="UTF-8"?>
        <EAPIdentityProviderList xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance" xsi:noNamespaceSchemaLocation="eap-metadata.xsd">
        <EAPIdentityProvider version="1" lang="en" ID="ac-dijon.fr" namespace="urn:RFC4282:realm">
        <AuthenticationMethods>
        <AuthenticationMethod>
        <EAPMethod>
        <Type>21</Type>
        </EAPMethod>
        <ServerSideCredential>
        <CA format="X.509" encoding="base64"></CA>
        <ServerID>radius1.ac-dijon.fr</ServerID>
        </ServerSideCredential>
        <ClientSideCredential>
        <OuterIdentity>anonymous@ac-dijon.fr</OuterIdentity>
        <InnerIdentitySuffix>ac-dijon.fr</InnerIdentitySuffix>
        </ClientSideCredential>
        <InnerAuthenticationMethod>
        <NonEAPAuthMethod>
        <Type>1</Type>
        </NonEAPAuthMethod>
        </InnerAuthenticationMethod>
        </AuthenticationMethod>
        </AuthenticationMethods>
        <CredentialApplicability>
        <IEEE80211>
        <SSID>eduroam</SSID>
        <MinRSNProto>CCMP</MinRSNProto>
        </IEEE80211>
        <IEEE80211>
        <ConsortiumOID>001bc50460</ConsortiumOID>
        </IEEE80211>
        </CredentialApplicability>
        <ProviderInfo>
        <DisplayName>Acadmie de Dijon</DisplayName>
        <ProviderLocation>
        <Longitude>3.158810555978562</Longitude>
        <Latitude>47.00316845435606</Latitude>
        </ProviderLocation>
        <ProviderLocation>
        <Longitude>3.5583041310746912</Longitude>
        <Latitude>47.79228759843727</Latitude>
        </ProviderLocation>
        <ProviderLocation>
        <Longitude>4.83885455148993</Longitude>
        <Latitude>46.31379469493169</Latitude>
        </ProviderLocation>
        <ProviderLocation>
        <Longitude>5.052595138549804</Longitude>
        <Latitude>47.33013782951147</Latitude>
        </ProviderLocation>
        <ProviderLogo mime="image/png" encoding="base64"></ProviderLogo>
        <Helpdesk>
        <EmailAddress>support-eduroam@ac-dijon.fr</EmailAddress>
        <WebAddress>http://eduroam.ac-dijon.fr/</WebAddress>
        </Helpdesk>
        </ProviderInfo>
        </EAPIdentityProvider>
        </EAPIdentityProviderList>"""

        runBlocking {
            val wifiConfigData = parser.parse(xml.toByteArray())
            assertEquals(listOf("eduroam"), wifiConfigData.ssids)
            assertEquals("anonymous@ac-dijon.fr", wifiConfigData.anonymousIdentity)
            assertEquals(listOf("radius1.ac-dijon.fr"), wifiConfigData.serverNames)
            assertEquals(1, wifiConfigData.caCertificates?.size)
        }
    }
